import React from 'react'
import PayWithPayPal from './Payment/PayWithPayPal'
import styled from 'styled-components';
import './Donations.css'

const StyledDonation = styled.div`
    width: 330px;
    margin:0 auto;

    @media (max-width: 768px) {
      
    }
    
`

function Donations() {
    return (
        <div className="donations">
            <StyledDonation>
                <PayWithPayPal items={[{name:'test', value:100.10}]} total={1000} />
            </StyledDonation>
            <StyledDonation>
                <PayWithPayPal items={[{name:'test2', value:99.10}]} total={999} />
            </StyledDonation>
            
        </div>
    )
}

export default Donations
